const Products = (props) => {
    return (
        <div>
            <img src={props.image} />
            <h1>{props.title}</h1>
            <h3>{props.price}</h3>
            <p>{props.description}</p>
            <button>Add To Wishlist</button>
            <button>View</button>
            <button>Add To Cart</button>
        </div>
    )
}

export default Products;
